{
	if (!this.site_EventListeners)
	{
	this.site_EventListeners= {};
	}
	this.site_EventListeners[name]=listener;
	
}

function site_DispatchEvent(eventObject)
{
	if (this.site_EventListeners)
	{
	var handler= this.site_EventListeners[eventObject.type];
	if (handler)
		{
			handler(eventObject);
		}
	}
}

